INSERT INTO `engine4_core_status` VALUES (1,'user',3,'******','2020-04-09 19:43:18'),(2,'user',1,'UX// user experience\n\nPosted by dan + doen + we + dat \n\nIn het kort: mbt de website\n-Als bezoeker kom je de site tegen via google of social media.\n-Je leest het e.e.a mbt de activiteiten die er zijn, waar je aan kan deelnemen, of zelf kan organiseren.\n-Je schrijft je gratis in.\n-Je krijgt dan een mail met een dankjewel voor de inschrijving, je inschrijving gaat in review.\n-Binnen 48 uur krijg je bericht via de e-mail, met approved/ of anders; en dan kom je op een wachtlijst.\n-Als je je hebt ingeschreven en je bent gemaild binnen 48 uur met approved, ben je lid.\n-Je kan dan meedoen met activiteiten.\n-Dan pas krijg je de betaalpagina, per maand kwartaal of jaar.\n-Als je betalend lid bent kan je organiseren en meedoen.\n-Als je meedoet, en de activiteit is vol dan kom je op de wachtlijst.\n-Meld iemand zich af dan krijg je een bericht.\n-Organiseer je zelf dan gaat je event voor goedkeuring langs admin.\n-Als het event is goedgekeurd, staat het in de agenda.\n-Dan kunnen anderen zich aanmelden.\n-Als organisator heb je een panel om je event te wijzigen, mensen te tippen, updates te plaatsen.\n-Activiteiten georganiseerd door admin hebben meer mogelijkheden, en de activiteiten kunnen ook meerdere dagen zijn.','2020-04-11 16:41:11'),(3,'user',1,'UX// user experience\n\nIn het kort: mbt de website\n-Als bezoeker kom je de site tegen via google of social media.\n-Je leest het e.e.a mbt de activiteiten die er zijn, waar je aan kan deelnemen, of zelf kan organiseren.\n-Je schrijft je gratis in.\n-Je krijgt dan een mail met een dankjewel voor de inschrijving, je inschrijving gaat in review.\n-Binnen 48 uur krijg je bericht via de e-mail, met approved/ of anders; en dan kom je op een wachtlijst.\n-Als je je hebt ingeschreven en je bent gemaild binnen 48 uur met approved, ben je lid.\n-Je kan dan meedoen met activiteiten.\n-Dan pas krijg je de betaalpagina, per maand kwartaal of jaar.\n-Als je betalend lid bent kan je organiseren en meedoen.\n-Als je meedoet, en de activiteit is vol dan kom je op de wachtlijst.\n-Meld iemand zich af dan krijg je een bericht.\n-Organiseer je zelf dan gaat je event voor goedkeuring langs admin.\n-Als het event is goedgekeurd, staat het in de agenda.\n-Dan kunnen anderen zich aanmelden.\n-Als organisator heb je een panel om je event te wijzigen, mensen te tippen, updates te plaatsen.\n-Activiteiten georganiseerd door admin hebben meer mogelijkheden, en de activiteiten kunnen ook meerdere dagen zijn.','2020-04-11 16:43:49'),(4,'user',1,'In het kort: mbt de website\n-Als bezoeker kom je de site tegen via google of social media.\n-Je leest het e.e.a mbt de activiteiten die er zijn, waar je aan kan deelnemen, of zelf kan organiseren.\n-Je schrijft je gratis in.\n-Je krijgt dan een mail met een dankjewel voor de inschrijving, je inschrijving gaat in review.\n-Binnen 48 uur krijg je bericht via de e-mail, met approved/ of anders; en dan kom je op een wachtlijst.\n-Als je je hebt ingeschreven en je bent gemaild binnen 48 uur met approved, ben je lid.\n-Je kan dan meedoen met activiteiten.\n-Dan pas krijg je de betaalpagina, per maand kwartaal of jaar.','2020-04-11 16:44:28'),(5,'user',1,'All the youtube links have a Russian description....','2020-04-25 22:23:20'),(6,'user',1,'All the youtube links have a Russian description....\nСмотрите любимые видео, слушайте любимые песни, загружайте','2020-04-25 22:24:25'),(7,'user',1,'All the youtube links have a Russian description....','2020-04-25 22:24:51'),(8,'user',1,'Смотрите любимые видео, слушайте любимые песни, загружайте собственные','2020-04-25 22:25:07'),(9,'user',1,'друзьями, близкими и целым миром.....','2020-04-25 22:25:52'),(10,'user',1,'Hello I am testing status. Mine is english.','2020-04-28 09:42:17'),(11,'user',1,'hey','2020-04-28 09:42:59'),(12,'user',1,'hhhhhhhhh','2020-04-29 16:33:36'),(13,'user',1,'друзьями, близкими и целым миром.....','2020-0