gepropt met stomende manden van dim sum.\r\n\r\nVolledig gerenoveerd in maart 2019, het interieur is modern met Aziatische elementen waardoor het een chique en moderne uitstraling heeft.','full-moon-garden','2020-08-01 17:00:00','2020-08-01 21:00:00',72,0,'Europe/Berlin',0,NULL,0,NULL,848,0,852,0,'Full Moon Garden (Dim Sum & Cantonese cuisine), Leidsestraat, Amsterdam, Nederland','Full Moon Garden','site',4,'user',1,0,1,0,0,0,1,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,20,0,0,0,0,0,0,0,0,0,NULL,NULL,0,0,'10.0.4.6',1,'2020-07-27 22:04:24','2020-07-27 22:04:24',NULL,NULL,NULL,0,0,99,NULL,NULL,0,0,'Undistributed',0,0,0,NULL,NULL,NULL,NULL,NULL,NULL),(35,3,'Wandelen in Portugal','De Serra da Estrela, de westelijke uitloper van het Castiliaans gebergte, is sinds 1976 natuurpark. Het beslaat een oppervlak van ruim 100.000 hectare en is daarmee het grootste natuurpark van Portugal.\r\n\r\nDe belangrijkse plaatsen in en even buiten het park zijn Guarda, Celorico da Beira, Gouveia, Seia en Covilhã.\r\n\r\nGuarda, Covilhã, Celorico da Beira en Gouveia zijn niet alleen per bus, maar ook per trein bereikbaar. De stations liggen wel behoorlijk ver van het centrum. Seia is alleen per bus bereikbaar. Voor dienstregeling (horários) spoorwegen en bussen klik hier\r\n\r\nDe overige plaatsen in het park zijn niet altijd even goed bereikbaar per bus. Informatie hierover is te verkrijgen bij de busstations (terminal de autocarros) in Guarda, Celorico da Beira, Covilhã, Seia en Gouveia. ','stadswandeling-evora','2020-08-04 08:39:00','2020-08-09 08:39:00',76,0,'Europe/Berlin',0,NULL,0,NULL,NULL,NULL,NULL,0,'Centro de Interpretação da Batalha do Vimeiro, Rua do Monumento, Vimeiro, Portugal','','site',5,'user',3,0,1,0,0,0,1,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,18,1,0,0,0,0,0,0,0,0,NULL,NULL,0,0,'10.0.4.6',1,'2020-07-27 22:47:57','2020-08-03 19:34:44',NULL,NULL,NULL,0,0,200,NULL,NULL,0,0,'Undistributed',0,0,0,NULL,NULL,NULL,NULL,NULL,NULL),(36,1,'Aziatische keuken kookcursus','De Aziatische keuken is wellicht de meest uitgebreide keuken aanzien het om veel verschillende landen gaat. Daarvan hebben in de Aziatische kookworkshop deze drie heerlijke keukens uit gekozen. Deze kookcursus wordt gegeven in een van onze kookstudio’s in Amsterdam.','aziatische-keuken-kookcursus','2020-08-15 09:00:00','2020-08-15 13:30:00',71,0,'Europe/Berlin',0,NULL,0,NULL,861,NULL,NULL,0,'Club Cuisine, Nieuwmarkt, Amsterdam, Nederland','Club Cuisine','site',4,'user',1,0,1,0,0,0,1,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,3,1,0,0,0,0,0,0,0,0,NULL,NULL,0,0,'10.0.4.6',1,'2020-08-03 11:14:33','2020-08-03 11:14:33',NULL,NULL,NULL,0,0,99,NULL,NULL,0,0,'Undistributed',0,0,0,NULL,NULL,NULL,NULL,NULL,NULL),(37,1,'Mountainbiken','Bij ASC Olympia rijden we niet alleen op de weg of op de baan. We hebben een groot aantal leden die naast wielrennen of baanwielrennen heel regelmatig mountainbiken in Amsterdam. Of (cyclo)crossen. Daarvoor hebben we ons eigen mountainbike/cyclocross parcours aangelegd op Sportpark Sloten.\r\n\r\nAls je aan mountainbiken denkt, denk je vaak aan de in modder gedrenkte fietser, die in duizelingwekkende vaart over bijna onmogelijke obstakels vliegt of een groepje bikers die zo snel mogelijk een steile heuvel afvliegen. Hoewel mountainbiken erg uitdagend en niet zonder risico is, is het niet per se de ‘extreme sport’ die veel mensen denken dat het is. Mountainbiken is een echte familiesport. Voor een steeds groter wordende groep mountainbikers is deze tak van de wielersport een heel goede manier om actief op de fiets te zitten.','mountainbiken','2020-08-22 09:00:00','2020-08-22 14:00:00',70,0,'Europe/Berlin',0,NULL,0,NULL,865,NULL,869,0,'ASC Olympia, Sloterweg, Amsterdam, Nederland','ASC Olympia','site',4,'user',1,0,1,0,0,0,1,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,5,1,0,0,0,0,0,0,0,0,NULL,NULL,0,0,'10.0.4.6',1,'2020-08-03 11:27:09','2020-08-03 11:27:10',NULL,NULL,NULL,0,0,99,NULL,NULL,0,0,'Undistributed',0,0,0,NULL,NULL,NULL,NULL,NULL,NULL),(38,1,'Voor de beginnende kitesurfer','<p>Voor de beginnende kitesurfer die graag eens wil proberen hoe het is om te kitesurfen bieden wij de introductie kitesurfles aan. Je leert over de veiligheid, het gebruik van de veiligheidssystemen, het optuigen van de kite, veilig besturen van de kite en gecontroleerd omgaan met de kracht van de kite. Dit door natuurlijk veel praktische oefeningen in het water zoals &lsquo;bodydraggen&rsquo; met de kite (je laat je achter de kite aan door het water trekken). Dit geeft je een goed idee hoe het voelt om met de kite om te gaan en bereid je voor op je eerste waterstart poging met het board. Maximaal 2 studenten per instructeur bij groepsles.</p>','voor-de-beginnende-kitesurfer','2020-08-30 09:00:00','2020-08-30 12:00:00',70,0,'Europe/Berlin',0,NULL,0,NULL,870,NULL,NULL,0,'Kitesurfschool Kitearena, Boulevard Paulus Loot, Zandvoort, Nederland','Kitearena','site',4,'user',1,0,1,0,0,0,1,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,48,2,0,0,0,0,0,0,0,0,NULL,NULL,0,0,'10.0.4.6',1,'2020-08-03 11:36:10','2020-08-26 15:40:38',NULL,NULL,NULL,0,0,99,18,88,0,0,'Undistributed',1,0,0,'','','0646280285',NULL,NULL,1),(40,15,'Deep Sea Diving','Let\'s say hello to the fishes!','diving','2020-08-03 00:38:00','2020-08-04 00:38:00',76,0,'Europe/Berlin',0,NULL,0,NULL,878,NULL,883,0,'Barrier Reef Australia, Spence Street, Cairns City QLD, Australia','','site',10,'user',15,0,1,0,0,0,1,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,86,1,0,0,0,0,0,0,0,0,NULL,NULL,0,0,'10.0.5.3',1,'2020-08-03 14:38:57','2020-08-24 17:41:17',NULL,NULL,NULL,0,3,5,29,39,0,0,'50/50',0,0,0,'','','+31646280285',NULL,NULL,1),(42,1,'Laser Tag','<p><strong>Laser Tag</strong></p>\r\n<p>We\'re going to play some laser tag! Bring your <em>Warrrr</em> face.</p>','lasertag','2020-08-08 10:31:00','2020-08-11 10:31:00',70,0,'Europe/Be